import React, {useEffect} from 'react';
import './Lead.css';
import {  useNavigate } from "react-router-dom";

const navigate = useNavigate();

const Lead =() => {


    const callLeads = async() => {
        try{
            const res = await fetch('/leads', {
                method: "GET",
                headers: {
                    Accept: "application/json",
                    "Content-Type" : "application/json"
                },
                credentials: "include"
            });

            const data = await res.json();
            console.log(data);

            if(!res.status === 200){
                const error = new Error(res.error);
                throw error;
            }

        } catch(err) {
            console.log(err);
            navigate('/login');
        }
    }

    useEffect(() => {
        callLeads();
    }, []);

    return(
        <div className={'leads'}>
            <h2> This is leads </h2>
            <p>Total Leads</p>
            <form method={"GET"}>
                <div className={'row'}>
                    <div className={'col-md-4'}>

                    </div>
                </div>
            </form>
        </div>
    )
}

export default Lead;
